    n = int(stdin.readline())
    numbers = list(map(int, stdin.readline().split()))

    def count_ways(start, end):
        s_sum = sum(numbers[start:end + 1])
        s_prod = 1
        for num in numbers[start:end + 1]:
            s_prod *= num
        return s_sum == s_prod

    count = 0
    for i in range(n - 1):
        for j in range(i + 1, n):
            if count_ways(i, j):
                count += 1

    return str(count)

